import React,{Component} from 'react'

class Signin extends Component{
constructor(props)
{
	super(props);
}

onEmailChange = (event) => {
    let email=event.target.value;
    fetch('http://apilayer.net/api/check?access_key=66fb493bc0447591cd91a0ef7c68335d&email=${enail}&smtp=1&format=1')
    .then(response=>response.json())
    if(response.mx_found===false)
    {
    	alert("This email address is inactive");
    }
}
render(){

const {onRouteChange} = this.props;
	return(
		<article className="br2 ba dark-gray b--black-10 mv4 w-100 w-50-m w-25-l mw5 center">
		<main className="pa4 black-80">
		  <form className="measure">
		    <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
	      	<legend className="f4 fw6 ph0 mh0">Sign In</legend>
		    <div className="mt3">
		       <label className="db fw6 lh-copy f6" for="email-address">Email</label>
		        <input 
		           className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" 
		           type="email" name="email-address" 
		           id="email-address" 
		           onChange={this.onEmailChange}
		         />
		      </div>
		      <div className="mv3">
		        <label className="db fw6 lh-copy f6" for="password">Password</label>
		        <input className="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" type="password" name="password"  id="password" />
		      </div>
		    </fieldset>
		    <div className="">
		      <input onClick={() => onRouteChange('Home')} className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" 
		             type="submit" 
		             value="Sign in" 
		       />
		    </div>
		    <div className="lh-copy mt3">
	      <a href="#0" className="f6 link dim black db">Sign up</a>
	    </div>
	  </form>
	</main>
	</article>
  )
}
}
export default Signin;
